VALUES ('3560071081690', 'Riz & légumes poulet à l\'indienne Sauce Tandoori', 'Composition Plat composé de riz long cuit, de légumes (18%), de dés de poulet marinés (15%), de sauce (13%) aux épices (0,07%) et fromage blanc, de lentilles corail cuites, de raisins secs bruns et de noix de cajou grillées. Ingrédients : Riz cuit 28% (eau, riz long étuvé), viande de poulet 13%, sauce aux épices et fromage blanc 13% (purée de tomate, crème, fromage blanc 1,9%, eau, tomate, oignon, amidon modifié de manioc, épices et plantes aromatiques (contient moutarde), ail, sel, jus de citron, sucre, arôme naturel, échalote, huile de toumesol, épaississant: gomme xanthane, conservateur : sortate de potassium), lentilles corail cuites 12% (eau, lentilles rouges), petits pois cuits 9%, choux fleurs cuits 9%, raisins secs bruns 3,5% (raisins secs, huile de colza), noix de calou grillées 3,3%, huile de colza, jeunes pousses dépinards, lait de coco, sel, graines de nigelle, huile de tournesol, jus de citron vert, eau, épices et plantes aromatiques (contient moutarde), arômes, tomates déshydratées, protéines végétales hydrolysées de mais et de toumesol, poudre de vinaigre. Peut contenir des traces de gluten, graines de sésame, crustacés, arachide et autres fruits à coque. Origine: Ce produit est fabriqué à partir de poulet né, élevé, abattu en France, et transformé en Espagne.', 'https://static.openfoodfacts.org/images/products/356/007/108/1690/front_fr.4.400.jpg', '4.3', '1.1', '16', '3.8', '2.9', '8.3', '1.1', '0.433070866141732', '', '0');

