VALUES ('3560071092078', 'sanus con L.casei', 'Leche desnatada fermentada con L. Casei, con extracto de ginseng y aromatizada, con edulcorantes, fuente de vitaminas D, B6, ácido fólico y B12. Ingredientes: Leche desnatada, leche desnatada en polvo, zumo de lima, almidón de maíz, extracto de ginseng 0,19%, aromas, fermentos lácticos con Lcasei, colorante: caramelo natural, edulcorantes: sucralosa y acesulfamo K, estabilizante: goma xantana, vitaminas: D, B6, ácido fólico y B12 Origen de la feche. España. Preparación: Agitar antes de abrir. Conservación: Fecha de caducidad: ver la fecha indicada en la parte superior del envase. Conservar entre +1°C y +8°C. Precauciones de empleo: No consumir más de una botella al día. Debe evitarse el consumo de otros alimentos que contengan Ginseng. No se recomienda el consumo en niños, mujeres embarazadas 0 en periodo de lactancia y en población bajo tratamiento médico. . 400', 'https://static.openfoodfacts.org/images/products/356/007/109/2078/front_es.11.400.jpg', '', '', '', '', '', '', '', '', '', '1');

