VALUES ('3560071154905', 'Gyozas sux crevettes', 'Gyozas aux crevettes (6 x 20 g) : Crevettes 37%, farine de blé, chou, eau, ciboulette, oignon, amidon de manioc, sauce soja (eau, graines de soja, farine de blé, sel), huile de sésame, ail, poivre, sucre, sel, gingembre. Pourcentage exprimé sur les gyozas aux crevettes. Sauce soja 20 g : Eau, sauce soja 35% (eau, graines de ga, sel, farine de blé), sucre, jus de citron concentré, épaississants : gomme guar - gomme xanthane. Pourcentage exprimé sur la sauce soja. Origine : Les Gyozas aux crevettes sont fabriqués au Viêt-nam à partir d\'ingrédients de diverses ongines, puis conditionnés en France. Ils sont farcis de crevettes élevées au Viêt-nam et aumpagnés d\'un sachet de sauce soja fabriqué en France à partir d\'ingrédients de diverses origines.', 'https://static.openfoodfacts.org/images/products/356/007/115/4905/front_fr.4.400.jpg', '4.1', '1.1', '23', '6.1', '1.1', '6.2', '1.6', '0.62992125984252', '', '0');

