INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3560071169602', 'Poulet tikka massala et son riz basmati', 'Riz basmati cuit 31 % (eau, riz basmati), filet de poulet 17%, _crème_ fraîche, oignons, eau, huiles végétales (colza, coton, tournesol), pulpe de tomate 3,7%, _yaourt_, _noix de cajou_, _oeuf_, amidon de pomme de terre, sirop de glucose, carotte, épices et plantes aromatiques, raisins secs 0,7%, _lait_, poivrons rouges, sel, épaississant gomme xanthane, jaune d\'_oeuf_, fibres végétales, stabilisant carraghénanes, _beurre_, protéines acidifiant : lactate de potassium, émulsifiant : lécithines (contient _soja_), sucre, miel, arômes naturels, _amandes_ en poudre, jus de citron à base de concentré, colorant : extrait de paprika.', 'https://static.openfoodfacts.org/images/products/356/007/116/9602/front_fr.11.400.jpg', '11', '3.2', '14', '2.6', '1.1', '9', '0.9', '0.354330708661417', '', '1');

